import React from 'react';
import { SidebarContainer, Icon, CloseIcon } from './SidebarElements';

const SideBar = () => {
  return (
    <SidebarContainer>
      <Icon>
        <CloseIcon />
      </Icon>
    </SidebarContainer>
  );
};

export default SideBar;
